import { Grid, Typography } from "@mui/material";
import React from "react";

export default function Page2() {
    return (
        <>
            <Grid container>
                <Grid item xs={4} sx={{ height: '200px', backgroundColor: 'gray' }}>
                    <Grid container>
                        <Grid item xs={5} sx={{ height: '200px', backgroundColor: 'red' }}>

                        </Grid>
                        <Grid item xs={5} sx={{ height: '200px', backgroundColor: 'yellow' }}>

                        </Grid>
                    </Grid>
                </Grid>
                <Grid item xs={4} sx={{ height: '200px', backgroundColor: 'blue' }}>

                </Grid>
                <Grid item xs={4} sx={{ height: '200px', backgroundColor: 'green' }}>

                </Grid>
            </Grid>
        </>
    );
}
